    class InvocationCounter:
        def __init__(self):
            self._count = 0

        def __call__(self):
            self._count += 1
            if stop_after is not None and self._count >= stop_after:
                loop.add_callback(self._stop)

        def count(self):
            return self._count

        def _stop(self):
            loop.stop()

    return InvocationCounter()

